import java.util.*;

/**
 * Objectif
 * Des caractères supplémentaires sont dispersés dans les phrases, parmi eux : ' ? ! / , . : ) %
 * Votre tâche est de compter combien de ces caractères se trouvent dans une phrase.
 *
 * ! L'espace n'est pas un caractère supplémentaire !
 *
 * Entrée
 * Une phrase
 *
 * Sortie
 * Un nombre - la quantité de caractères supplémentaires
 *
 * Contraintes
 * 3 <= longueur de la phrase <= 100
 *
 * Exemple
 * Entrée
 * Where's your motivation?
 *
 * Sortie
 * 2
 */
class Solution {

    public static void main(String args[]) {
        Scanner in = new Scanner(System.in);
        String SENTENCE = in.nextLine();
        
        // Supprime tous les caractères alphanumériques et les espaces
        SENTENCE = SENTENCE.replaceAll("[A-Za-z0-9 ]", "");
        
        // Affiche la longueur de la chaîne résultante, qui est la quantité de caractères supplémentaires
        System.out.println(SENTENCE.length());
    }
}

