float calculateX(int x, float sum, int num, float copyOfSum) {      
    sum = pow (x, num);
    for (int i = 1; i <= num; i++) {
        sum = (float)sum / i;
    }
    num += 2;
    if(num != 13) {
        copyOfSum += sum;
        return calculateX(x, -sum, num, copyOfSum);
    }
    return copyOfSum;
}

