void backTracking(int x[], int k,int  p, int  &counter, int n) {
    for (int i = 1; i <= n; ++i) {
        x[k] = i;
        if (igeretes(x, k)) {
            if (k == p - 1) {
                counter++;
                kiir(x, k);
            } else {
                backTracking(x, k + 1, p, counter, n);
            }
        }
    }
}
