internal class Program
    {
        static void Main(string[] args)
        {
            const string CommandAddFish = "1";
            const string CommandRemoveFish = "2";
            const string CommandExit = "3";

            bool isWorking = true;
            Aquarium aquarium = new Aquarium();

            while (isWorking)
            {
                aquarium.GetFishDeath();
                aquarium.GetRestLife();
                aquarium.ShowAllFish();

                Console.WriteLine("Меню <Аквариума>.\n" +
                    "Можете выбрать одно из следующих действий: \n"  +
                    $"{CommandAddFish} - Добавить рыбу.\n" +
                    $"{CommandRemoveFish} - Достать рыбу из аквариума.\n" +
                    $"{CommandExit} - Выход.");
                string userInput = Console.ReadLine();

                switch (userInput)
                {
                    case CommandAddFish:
                        aquarium.AddFish();
                        break;

                    case CommandRemoveFish:
                        aquarium.RemoveFish();  
                        break;

                    case CommandExit:
                        isWorking = false;
                        Console.WriteLine("Вы вышли из программы....");
                        break;

                    default:
                        Console.WriteLine("Неправильный ввод");
                        break;
                }
            }
        }
    }

    class Aquarium
    {
        private List<Fish> _fish = new List<Fish>();
        private int _maxFishAge = 10;

        public void ShowAllFish()
        {
            if(_fish.Count > 0)
            {
                for(int i = 0; i < _fish.Count; i++)
                {
                    Console.Write($"{i+1})");
                    _fish[i].ShowInfo();
                }
            }
            else
            {
                Console.WriteLine("Рыб в этом аквариуме нет.");
            }
        }

        public void AddFish()
        {
            int maxCountOfFish = 12;

            if(_fish.Count < maxCountOfFish)
            {
                string nameFish;
                string ageFish;
                bool isNumber = true;

                Console.WriteLine("Введите название рыбы: ");
                nameFish = Console.ReadLine();
                Console.WriteLine("Введите возраст рыбы: ");
                ageFish = Console.ReadLine();
                isNumber = int.TryParse(ageFish, out int age);

                if (isNumber == false)
                {
                    Console.WriteLine("Неправильный ввод.");
                }
                else if (age >= _maxFishAge)
                {
                    Console.WriteLine("Ввод превышает возраст рыб.");
                }
                else
                { 
                    _fish.Add(new Fish(nameFish, age));
                    Console.WriteLine("Рыба добавлена к списку.");
                }
            }
        }

        public void RemoveFish()
        {
            if (_fish.Count > 0)
            {
                Console.WriteLine("Введите название рыбы, чтобы достать ее из аквариума: ");
                string nameFish = Console.ReadLine();

                for(int i = 0; i < _fish.Count; i++)
                {
                    if(nameFish == _fish[i].Name)
                    {
                        Console.WriteLine("Рыбу выложили из аквариума.");
                        _fish.RemoveAt(i);
                    }
                    else
                    {
                        Console.WriteLine("К сожалению, такой рыбы нету.");
                    }
                }
            }
        }

        public void GetFishDeath()
        {
            for(int i = 0; i < _fish.Count; i++)
            {
                if(_fish[i].Age >= _maxFishAge)
                {
                    Console.WriteLine($"Рыба {_fish[i].Name} умерла от старости((");
                    _fish.Remove(_fish[i]);
                }
            }
        }

        public void GetRestLife()
        {
            for(int i =0; i < _fish.Count; i++)
            {
                _fish[i].LiveToDeath();
            }
        }
    }

    class Fish
    {
        public Fish(string name, int age)
        {
            Name = name;
            Age = age;
        }

        public string Name { get; private set; } 

        public int Age { get; private set; }

        public void ShowInfo()
        {
            Console.WriteLine($"Название рыбы: {Name}.Возраст рыбы: {Age}.");
        }

        public void LiveToDeath()
        {
            Age++;
        }
    }

